modelNeuronerdz.addBlog = (blog) => {

    return modelNeuronerdz.getBlogByTitle(blog.blogTitle).then(existBlog => {
        if (existBlog) {
            let err = new Error();
            err.message = "blog is already present with Title " + blog.blogTitle;
            err.status = 404;
            throw err;
        }
        else {
            return modelNeuronerdz.createBlogId().then(blogId => {
                blog.blogId = blogId + 1;
                if (!blog.blogImage)
                    blog.blogImage = imageUrl;
                return schema.getBlogSchema().then(model => {
                    return model.create(blog).then(idata => {
                        if (idata)
                            return idata.blogId;
                        else
                            return null;
                    })
                })
            });

        }
    })


}


modelNeuronerdz.updateBlog = (blogId, blog) => {

    return modelNeuronerdz.getBlogByTitle(blog.blogTitle).then(existBlog => {
        if (existBlog && existBlog.blogId != blogId) {

            let err = new Error();
            err.message = "blog is already present with Title " + blog.blogTitle;
            err.status = 404;
            throw err;
        }
        else {
            if (!blog.blogImage)
                blog.blogImage = imageUrl;
            return schema.getBlogSchema().then(model => {
                return model.updateOne({ blogId: blogId }, {
                    $set: {
                        blogBody: blog.blogBody,
                        blogCategory: blog.blogCategory,
                        blogTagNames: blog.blogTagNames,
                        blogTitle: blog.blogTitle,
                        blogAuthor: blog.blogAuthor,
                        blogImage: blog.blogImage
                    }
                }).then(udata => {
                    if (udata.nModified == 1)
                        return blogId;
                    else
                        return null;
                })
            })


        }
    })


}

