modelNeuronerdz.getAllCategories = () => {
    return schema.getBlogSchema().then(model => {
        return model.aggregate(
            [
                {
                    $group: {
                        _id: "$blogCategory.main",
                        totalBlog: { $sum: 1 }
                    }
                },
                { $project: { _id: 0, _id: 1, totalBlog: 1 } }
            ]
        ).then(categoryMain => {
            if (categoryMain.length > 0)
                return categoryMain;
            else
                return null;
        })
    })
}
modelNeuronerdz.getAllTitles = () => {
    return schema.getBlogSchema().then(model => {
        return model.find({}, { _id: 0, blogTitle: 1 }).then(blogTitle => {
            if (blogTitle.length > 0) {
                let allTitles = [];
                for (let title of blogTitle) {
                    allTitles.push(title.blogTitle);
                }
                return allTitles;
            }
            else
                return null;
        })
    })
}
modelNeuronerdz.search = (searchTag) => {
    return schema.getBlogSchema().then(model => {
        return model.find(
            {
                $or: [
                    { "blogCategory.main": searchTag },
                    { "blogCategory.sub": searchTag },
                    { "blogTagNames": searchTag },
                    { "blogAuthor": searchTag },
                    { "blogTitle": searchTag }
                ]
            },
            { _id: 0 }
        ).then(searchResult => {
            if (searchResult.length > 0) {
                return searchResult;
            }
            else
                return null;
        })
    })
}

modelNeuronerdz.addComment = (comment, blogId) => {
    return modelNeuronerdz.createCommentId().then(commentId => {
        comment.commentId = commentId + 1;
        return schema.getBlogSchema().then(model => {
            return model.updateOne(
                { blogId: blogId },
                { $push: { blogComments: comment } }
            ).then(cdata => {
                if (cdata.nModified == 1)
                    return blogId;
                else
                    return null
            })
        })
    })

}

