modelNeuronerdz.addCategory=(categoryObj)=>{
    return modelNeuronerdz.getAllCategory().then(categories=>{
       categories.forEach(data=>{
           if(data.category===categoryObj.category.toLowerCase())
                {
                    let err = new Error();
                    err.message = "Category already exist"
                    err.status = 404;
                    throw err;
                }

       })
       return schema.getCategorySchema().then(model=>{
           return model.create(categoryObj).then(category => {
            if (category)
                return category.category
            else
                return null;
        })
       })
    })
}
modelNeuronerdz.addUser = (user) => {

    return modelNeuronerdz.getUserByUserName(user.userName).then(checkUserName => {
        if (checkUserName) {

            let err = new Error();
            err.message = "UserName already exist"
            err.status = 404;
            throw err;
        }
        else {

            return modelNeuronerdz.getUserByEmailId(user.emailId).then(checkEmailId => {
                if (checkEmailId) {
                    let err = new Error();
                    err.message = "EmailId already exist"
                    err.status = 404;
                    throw err;
                }
                else {
                    return modelNeuronerdz.createUserId().then(userId => {
                        user.userId = userId + 1;
                        return schema.getUserSchema().then(model => {
                            return model.create(user).then(userData => {
                                if (userData)
                                    return userData.userName;
                                else
                                    return null;
                            })
                        })
                    })

                }
            })

        }
    })

}
modelNeuronerdz.updateUser = (userName, user) => {
    return modelNeuronerdz.getUserByEmailId(user.emailId).then(userByEmail => {
        if (userByEmail && userByEmail.userName != userName) {
            let err = new Error();
            err.message = "EmailId already exist"
            err.status = 404;
            throw err;
        }
        else {

            return schema.getUserSchema().then(model => {
                return model.updateOne(
                    { userName: userName },
                    { $set: {
                        name:user.name,
                        emailId:user.emailId,
                        userPermission:user.userPermission
                    } }
                ).then(userData => {
                    if (userData.nModified==1)
                        return user;
                    else
                        return null;
                })
            })
        }
    })


}
